import { Server } from 'miragejs'
import kfc from './assets/images/kfc.png'
import bk from './assets/images/bk.png'
import sp from './assets/images/sp.png'

export function makeServer(): object {
  return new Server({
    routes(): void {
      this.namespace = 'api'

      this.get('/restaurants', () => {
        return [
          {
            id: 1,
            name: 'Kentucky Fried Chicken',
            phone: '+36 1 610 5717',
            distance: '0.75 km',
            image: `url(${kfc})`,
            vote: false,
          },
          {
            id: 2,
            name: 'Burger King',
            phone: '+36 70 452 3457',
            distance: '0.85 km',
            image: `url(${bk})`,
            vote: true,
          },
          {
            id: 3,
            name: 'Salt and Pepper',
            phone: '+36 70 622 6277',
            distance: '2.3 km',
            image: `url(${sp})`,
            vote: false,
          },
        ]
      })
    },
  })
}
